exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption}=await require("transcode/parse_catalog"),replaceFont=await require("transcode/font_map"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.aoqingshu.com/${bid}/${page}-1.html`,"dl.panel-chapterlist",{...options,clientOptions,pageSize:20,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("\u7AE0"))?.subRegex(/\/(\d+)-\d+\.html/)?.intValue(),preprocess:html=>replaceFont(html,/<i>&#x([a-f\d]{4})<\/i>/g),idRegex:/\/(?<id>[a-z\d]+)\.html/})};